import {Link} from 'react-router-dom';
import { useContext,useState,useEffect } from 'react';


const Home = () => {
  const [workouts, setWorkouts] = useState(null);
  useEffect(()=> {
    fetch('http://localhost:8001/workouts').then(
      res=> {
        return res.json();
      }
    ).then((data) =>{
      console.log(data);
      setWorkouts(data);
    }
    )
  },[])
    return (
        <div className = 'home'>
            <title>
              Gym Tracker Site
            </title>
            <nav>
                <button>
                    <Link to="/create" className='link'>Add a Workout</Link>
                </button>
            </nav>
            
            <div>
              <h2> Previous Workouts</h2>
              {workouts && workouts.map((workout)=> (
                <div className="workout-preview" key={workouts.id}>
                      <p>{workout.date}</p>
                      <p>{workout.type}</p>
                      
                      <br/>
                </div> 
              ))}
            </div>
            
            
           
        </div>
    );
}
 
export default Home;
